export default{
    state:{
        isCollapse:false,
        tabList:[{
            path: '/home',
            name: 'home',
            label: '扶뒬못',
            icon: 's-home',
            url: 'Home/Home'
        },
        ]
    },
    mutations:{
        changeCollapse(state){
            state.isCollapse=!state.isCollapse;
        }
    }
}
